import React from 'react';
import { ToolsIcon } from '@iconbox/oct';
import CookieService from '../../CookieService';
import { useHistory } from 'react-router';
import { Nav, Navbar, NavDropdown, Container } from 'react-bootstrap'


function Navbarvv() {

    let history = useHistory();

    if (CookieService.get("Token")) {
        var id = CookieService.get("_id");
    }


    const logout = async (id) => {
        try {
            await fetch(`http://localhost:3001/users/logout/${id}`, {
                method: "post",
            });
            CookieService.remove("Token");
            CookieService.remove("_id");
            CookieService.remove("Role");
            history.push("/");

        } catch (e) {
            alert(e);
        }

    }


    return (

        <Navbar collapseOnSelect expand="lg" bg="dark" variant="#0B58CA">
            <Container>

                <Navbar.Brand href="#home">
                    <ToolsIcon style={{ width: "30px" }} />
                </Navbar.Brand>

                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                    <Nav className="me-auto">
                        <Nav.Link href="#features">Features</Nav.Link>
                        <Nav.Link href="#pricing">Pricing</Nav.Link>
                    </Nav>
                    <Nav>
                        <Nav.Link eventKey={2} href="#memes">
                            Home
                        </Nav.Link>

                        {CookieService.get("Token") ? (



                            <NavDropdown style={{ color: '#0B58CA' }} title="Me" id="collasible-nav-dropdown">
                                <NavDropdown.Item href="/profile">Profile</NavDropdown.Item>
                                <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                                <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                                <NavDropdown.Divider />
                                <NavDropdown.Item onClick={logout(id)} >Logout</NavDropdown.Item>
                            </NavDropdown>
                        ) : (

                            <Nav.Link href="/signin">Signin</Nav.Link>

                        )}


                        <Nav.Link href="#deets">GPS</Nav.Link>


                    </Nav>


                </Navbar.Collapse>
            </Container>
        </Navbar>
    )
}

export default Navbarvv
